import React, { Component,Fragment } from 'react';
// import list from "./data/datalist.js";

class HomePage extends Component{
    constructor(props){
        super(props)
    }
    render(){
        const {name,sex,age,hobby} = this.props;
        return(
            <Fragment>
                <div>
                    主页面
                </div>
                <div>
                    <h3>姓名：{name}</h3>
                    <h3>性别：{sex}</h3>
                    <h3>年龄：{age}</h3>
                    <h3>爱好：{hobby}</h3>
                </div>
            </Fragment>
        )
    }
}

export default HomePage;
